PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `Academic_Year` (
	`academic_year` YEAR,
	PRIMARY KEY (`academic_year`)
);
CREATE TABLE `exams` (
`Exam_Id` TEXT(100) NOT NULL DEFAULT '',
`ExamDate` DATE NOT NULL,
`ExamTotalMarks` DECIMAL NOT NULL,
`ExamWeightage` DECIMAL NOT NULL,
PRIMARY KEY (`Exam_Id`)
);
CREATE TABLE `teacher` (`teacher_id` TEXT(36) NOT NULL,`fname` TEXT(20) NOT NULL,`lname` TEXT(20) NOT NULL,`dob` DATE NOT NULL,`gender` TEXT(10) NOT NULL,`admin_id` TEXT(50) NOT NULL,PRIMARY KEY (`teacher_id`));
COMMIT;
